import React from 'react';
import Button from 'antd/es/button'
import Header from './components/layout/Header';
import Form from './components/InputForm'
import './App.css';

class App extends React.Component {
  constructor(props){
    super(props)
  }

  render(){
    return (
      <div className="App">
        <Header />
        <Form/>
      </div>
    );
  }
}

export default App;
